import React, { useState, useEffect } from "react";
import './Home.css'
import styled from 'styled-components'
import { StringsList, SearchInput } from 'components'
import { AddStringModal } from 'components/Views/Modals/AddString'

const Home = () => {
  const [stringList, setStringList] = useState([""]);

  useEffect(() => {
    fetch("http://localhost:3001/")
      .then((res) => res.json())
      .then((json) => {
        setStringList(json.data);
      })
      .catch((err) => {
        console.log("error: ", err);
      });
  }, []);

  return (
    <>
      <MainContainer>
        <SearchInput></SearchInput>
        <StringsList stringList={stringList} setStringList={setStringList}></StringsList>
      </MainContainer>
      <AddStringModal />
    </>
  )
}

const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`

export default Home
